Information
------------------------------

Prostitution: What's the Harm? 
This documentary sets out to examine the attitudes and experiences of young people in the UK to prostitution. Presented by Billie J D Porter, the programme will reflect a wide range of opinions and experiences. It will feature the young men who buy sex and the young women who sell it and will look at the different motivations for paying for sex and at the changing nature of the industry. It will also reflect the moves being made by some politicians to ban outright the purchase of sex, question who they are trying to criminalise, and ask - what is the right approach?

